import React from 'react';
import './Home.css'

function Home() {
  return (
    <div className='home'>
      <a className='MuiButtonBase-root MuiButton-root MuiButton-contained button MuiButton-containedSecondary' tabIndex='0' aria-disabled='false' href='https://discord.com/oauth2/authorize?client_id=775542914117795860&permissions=8&scope=bot' target='_blank'>
        <span className='MuiButton-label'>
          <span className='MuiButton-startIcon MuiButton-iconSizeMedium'>
            <svg className='MuiSvgIcon-root' focusable='false' viewBox='0 0 24 24' aria-hidden='true'>
              <path d='M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm5 11h-4v4h-2v-4H7v-2h4V7h2v4h4v2z'></path>
            </svg>
          </span>
        </span>
      </a>
    </div >
  );
}

export default Home;
